import React from "react";

function Card(props){
    return(
        <div>
            <div class="card" style= {{width: "18rem", backgroundColor: "black"}}>
                <div class="card-body" style={{color:"white"}}>
                <h5 class="card-title">{props.name}</h5>
                <p class="card-text">Some quick example text to buil.</p>
            
                </div>
            </div>
        </div>
    )
}

export default Card;
